import { useState } from "react";

function App() {
  // default active tab = "Home"
  const [activeTab, setActiveTab] = useState("Home");

  // tab content
  const renderContent = () => {
    switch (activeTab) {
      case "Home":
        return <p>This is Home page</p>;
      case "About":
        return <p>This is About page</p>;
      case "Contact":
        return <p>This is Contact page</p>;
      default:
        return null;
    }
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      {/* Tab buttons */}
      <div style={{ marginBottom: "20px" }}>
        <button
          style={{
            margin: "5px",
            backgroundColor: activeTab === "Home" ? "lightblue" : "white"
          }}
          onClick={() => setActiveTab("Home")}
        >
          Home
        </button>
        <button
          style={{
            margin: "5px",
            backgroundColor: activeTab === "About" ? "lightblue" : "white"
          }}
          onClick={() => setActiveTab("About")}
        >
          About
        </button>
        <button
          style={{
            margin: "5px",
            backgroundColor: activeTab === "Contact" ? "lightblue" : "white"
          }}
          onClick={() => setActiveTab("Contact")}
        >
          Contact
        </button>
      </div>

      {/* Tab content */}
      <div>{renderContent()}</div>
    </div>
  );
}

export default App;
